link.script:
const lastGridIconEvent = {
  event: undefined,
  target: undefined
}
const gridIconClickListener = (event) => {
  event.preventDefault()
  event.stopPropagation()
  lastGridIconEvent.event = event
  lastGridIconEvent.target = event.target
}
var gridIconsElements
const addGridListeners = () => {
  gridIconsElements = document.getElementsByClassName('grid-icon__link')
  for (var i = 0; i < gridIconsElements.length; i++) {
    gridIconsElements[i].addEventListener('click', gridIconClickListener)
  }
}
addGridListeners()
document.addEventListener("DOMContentLoaded", (e) => {
  addGridListeners()
})
window.delayIconGridClickCleanup = () => {
  for (const el of gridIconsElements) {
    el.removeEventListener('click', gridIconClickListener)
  }
  if (lastGridIconEvent.target && lastGridIconEvent.event)
    lastGridIconEvent.target.dispatchEvent(lastGridIconEvent.event)
}

body.script:
// Define dataLayer and the gtag function.
window.dataLayer = window.dataLayer || [];
function gtag(){dataLayer.push(arguments);}

// Default analytics_storage to 'denied'.
gtag('consent', 'default', {
  'ad_storage': 'denied',
  'analytics_storage': 'denied'
});

dataLayer.push({
  'event': 'default_consent'
});
